import React from 'react';

const Highlight = () => {
    return (
        <>
            <div className="highlight">
                <div className="article-list thumbnail">
                    <img src="http://img.youtube.com/vi/BAgLhfmuV3Q/0.jpg"/>
                </div>
                <div className="article-list content">
                    <div className="article__title">
                        <a href="#">
                            <span>유튜브 테스트</span>
                        </a>
                    </div>
                </div>
                <div className="article-list raiting">
                    <img style={{marginBottom: "5px"}}src="/static/up.svg"/>
                    <div className="vote">78</div>
                    <img src="/static/down.svg"/>
                </div>
            </div>
            <style jsx>
                {`
                    .highlight {
                        padding: 20px;
                        height: 170px;
                        border-radius: 10px;
                    }
                    .article-list {
                        float: left;
                    }
                    .highlight .raiting{
                        font-size: 20px;
                    }
                    .highlight .raiting img {
                        width: 25px;
                        hight: 25px;
                    }
                    .content {
                        text-align: center;
                        width: 850px;
                        line-height: 50px;
                        margin: 0 auto;
                    }
                    .article__title a span{
                        color: #2955BC;
                        font-size: 26px;
                        font-family: dotum;
                        text-decoration: none;
                    }
                    .thumbnail img{
                        width: 150px;    
                    }
                `}
            </style>
        </>
    )
};

export default Highlight;
